mapper.select:
select 

from pg_statistic
where starelid = #{starelid,jdbcType=BIGINT}
  and staattnum = #{staattnum,jdbcType=SMALLINT}
  and stainherit = #{stainherit,jdbcType=BIT}

mapper.delete:
delete from pg_statistic
where starelid = #{starelid,jdbcType=BIGINT}
  and staattnum = #{staattnum,jdbcType=SMALLINT}
  and stainherit = #{stainherit,jdbcType=BIT}
